// Test.jsx

import React from 'react';
import LoginTest from './Pages/LoginTest';
import PageAcceuil from './Pages/PageAcceuil';

function Test() {
  return (
      <Router>
         <Routes>
         <Route path="/" element={<LoginTest />} />
         <Route path="/acceuil" element={<PageAcceuil />} />
         </Routes>
      </Router>
  );
}

export default Test;
